import React from 'react';
import ReactDOM from 'react-dom'; // Import ReactDOM directly from 'react-dom'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import necessary components from react-router-dom
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import AboutUs from './aboutUsboutUs'; // Ensure correct case and path for AboutUs component

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Switch>
      <Route path="/aboutUs" component={AboutUs} />
    </Switch>
  </Router>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
